INSERT INTO `board` VALUES (22,'허리 통증, 함께 이야기해봐요','마석삼','안녕하세요, 여러분. 저는 허리 통증으로 힘들어하고 있는 중년입니다. 일상생활에서도 자주 아프고, 운동을 해도 그 효과가 미비하네요. 혹시 여러분도 비슷한 경험이 있으신가요? 어떤 방법으로 통증을 관리하고 계신지, 서로의 경험을 나누면 도움이 될 것 같습니다. 여러분의 조언과 이야기를 기다립니다.','2024-08-19 17:19:59',6),(23,'우울증과의 싸움, 경험을 나누고 싶어요','이민정','안녕하세요. 최근 우울증으로 많은 어려움을 겪고 있는 이민정입니다. 치료를 받고 있지만, 종종 감정적인 기복이 심해지고, 혼자서 감당하기 힘들 때가 많습니다. 여러분은 어떻게 우울증을 극복하고 계신가요? 혹시 비슷한 경험이 있으신 분들이 계시면 조언을 부탁드립니다.','2024-08-19 17:23:40',7),(25,'고혈압 관리, 어떤 방법이 효과적이었나요?','김철호','안녕하세요. 고혈압으로 인해 걱정이 많아진 김철호입니다. 식단 조절과 약물 복용을 병행하고 있지만, 효과가 제한적이라 고민 중입니다. 여러분이 고혈압을 관리하기 위해 시도해본 효과적인 방법이나 팁이 있다면 공유해 주세요.','2024-08-19 17:25:08',23),(28,'마음이 화끈화끈합니다.. 왜이러죠','상철','혹시 이런 증상 있으신분 있나요.?','2024-08-20 09:31:49',22),(30,'관절염의 고통과 극복 방법이 있을까요 ?','현숙','안녕하세요, 저는 65세의 은퇴한 공무원입니다. 최근 몇 년간 관절염으로 인한 통증이 점점 심해지고 있습니다. 특히 겨울철에 관절이 더 뻣뻣해지고 아프네요. 의사에게 물어보니, 꾸준한 운동과 물리 치료가 도움이 된다고 하더군요. 그래서 매일 아침 스트레칭과 가벼운 걷기를 시작했습니다. \n\n','2024-08-20 12:40:24',7),(31,'고혈압 두통  어떻게 관리 하나요','영자','안녕하세요, 72세의 노인입니다. 고혈압으로 인해 두통이 자주 발생합니다. 의사에게 문의해보니, 고혈압이 두통의 원인일 수 있다고 하더군요. 두통 완화를 위해 약물 외에 어떤 방법을 사용하시나요? 또한, 혈압 관리를 잘 하기 위한 생활 습관이나 음식이 있다면 추천해 주세요.\n\n','2024-08-20 12:41:59',9),(32,'심장병  있으신분, 앓고 계신분, 앓으셨던 분 이야기 나눠요 ','영철','안녕하세요. 70세의 노인입니다. 심장병 진단을 받고 생활습관을 많이 바꾸었습니다. 식사도 조절하고 규칙적인 운동을 하려고 노력 중입니다. 그러나 여전히 가끔 가슴이 답답하고 피로를 느끼네요. 다른 분들은 심장병 관리와 관련해 어떤 방법을 사용하고 계신가요? 효과적인 조언이나 경험이 있다면 알려주세요.\n\n','2024-08-20 12:43:18',13),(33,'골다공증 관리에 관한 꿀팁 공유해요','김복자','안녕하세요, 저는 68세의 여성입니다. \n최근 골다공증 진단을 받았는데, 뼈가 약해지는 게 걱정이네요. \n의사에게 칼슘과 비타민 D 섭취를 권장받았지만, \n어떤 음식을 먹어야 하는지 잘 모르겠습니다. \n여러분은 어떤 방법으로 골다공증을 관리하고 계신가요?\n효과적인 식이요법이나 운동이 있다면 공유해 주세요.\n\n','2024-08-20 12:52:54',18),(36,'60대의 건강을 지키는 간단한 팁과 조언','정숙','나이가 들면서 건강이 점점 더 중요해지죠. 제가 최근에 시도해 본 몇 가지 간단한 건강 관리 방법을 공유해 보려고 합니다. 여러분의 건강에도 도움이 되길 바랍니다!\n규칙적인 운동은 필수!\n매일 30분 정도 걷는 것이 좋습니다. 걷기는 심혈관 건강에 도움을 주고, 기분도 좋게 만들어 줍니다.\n운동이 부담스럽다면, 집에서 할 수 있는 가벼운 스트레칭이나 요가도 좋은 선택입니다.\n','2024-08-21 12:42:32',1),(37,'식사 시 물 한 잔, 제가 생각하는 건강 비결입니다. ','영철','식사 전 물 한 잔 마시는 습관을 가지세요. 소화를 돕고 과식을 예방할 수 있습니다. 간단하지만 효과적인 건강 팁입니다!\n\n','2024-08-21 12:43:58',5),(38,'걷기, 건강한 습관 만들기','영숙','매일 20~30분 걷기를 시도해 보세요. 걷기는 심장 건강에 좋고 스트레스도 줄여줍니다. 가까운 공원에서 산책하는 것으로 시작해 보세요!','2024-08-21 12:44:51',7);
