INSERT INTO `board_re` VALUES (11,22,'안녕하세요, 마석삼님. 저도 허리 통증으로 오랜 시간 고생했습니다. 물리치료와 스트레칭이 많이 도움이 되었어요. 그리고 요즘은 매일 30분 정도 걷는 걸 습관으로 만들었어요. 조금이라도 도움이 되길 바랍니다!','이정숙','2024-08-19 17:21:16'),(12,22,'저도 허리 통증 때문에 힘들었는데, 최근에 체중을 좀 줄이고, 꾸준히 요가를 하니 많이 나아졌어요. 비슷한 경험을 나눌 수 있어 좋네요. 서로 힘내요!','박철수','2024-08-19 17:21:38'),(13,23,'안녕하세요, 이민정님. 저도 우울증을 경험해본 적이 있어요. 전문 상담과 약물 치료가 큰 도움이 되었어요. 그리고 주변 사람들과 소통하는 것도 중요하더라고요. 함께 이겨내봐요!','김지현','2024-08-19 17:24:06'),(14,23,'안녕하세요. 우울증은 정말 힘든 경험이에요. 저도 꾸준히 운동과 명상을 통해 많이 좋아졌어요. 필요한 경우 전문가와 상담하는 것도 좋은 방법이랍니다. 힘내세요!','정우진','2024-08-19 17:24:25'),(15,25,'안녕하세요, 김철호님. 저는 저염식이랑 꾸준한 운동을 병행하면서 고혈압이 많이 좋아졌어요. 그리고 정기적으로 혈압을 체크하는 것도 중요해요. 도움이 되길 바랍니다!','이민정','2024-08-19 17:25:51'),(16,25,'저도 고혈압으로 고생했었는데, 규칙적인 운동과 식이요법이 큰 도움이 되었어요. 그리고 스트레스 관리도 중요하더라고요. 서로 도움이 되었으면 좋겠어요!','박철수','2024-08-19 17:26:17'),(17,25,'좋은사람을 만나면.. 혈압이 자연스럽게낮아지고... 웃음이많아집니다.. ','상철','2024-08-20 09:31:15'),(19,32,'안녕하세요. 심장병 관리가 어렵죠. 저는 식사 조절 외에도 심장에 좋은 음식을 많이 먹으려고 합니다. 예를 들어, 오메가-3가 풍부한 생선이나, 섬유소가 많은 채소를 자주 먹어요. 또한, 매일 걷기 운동을 통해 심장 건강을 유지하려고 합니다. 가끔은 심리적 안정을 위해 명상도 합니다.\n\n','영자','2024-08-20 12:44:02'),(20,30,'저도 비슷한 문제를 겪고 있습니다. 최근에 관절염에 좋은 영양제를 찾아서 복용하고 있는데, 어느 정도 도움이 되는 것 같습니다. 특히 오메가-3가 함유된 보충제가 좋다고 하더군요. 그리고 일상적인 스트레칭도 꾸준히 해보세요. 작은 변화가 큰 도움을 줄 수 있습니다.\n\n','영자','2024-08-20 12:44:12'),(21,28,'제가 그런 적이 있었는데 알고보니 남편 때문에 온 홧병이더라구요 요즘엔  한의원 가서 치료하면 실비도 되니까 한번 가셔서 증상 말씀하시고 침도 맞고 열도 내려보세요 훨 낫드라구요 ','영자','2024-08-20 12:44:54'),(22,32,'심장병 관리에는 식사와 운동이 모두 중요합니다. 저는 저지방 식단을 유지하면서 규칙적인 운동을 하고 있습니다. 그리고 심장에 좋은 영양제도 챙겨먹고 있어요. 여러분의 건강 상태에 맞는 적절한 운동과 식단을 찾는 것이 중요합니다. 그리고 꾸준히 건강 검진을 받는 것도 좋습니다.\n\n','현숙','2024-08-20 12:45:34'),(23,31,'안녕하세요. 고혈압으로 인한 두통이 정말 고통스럽죠. 저는 두통이 자주 발생할 때마다 혈압을 체크하고, 적절한 휴식을 취하는 것이 도움이 되었습니다. 그리고 혈압을 안정시키기 위해 매일 규칙적인 운동과 건강한 식습관을 유지하고 있습니다. 두통 완화를 위해 카페인 섭취를 줄이기도 했습니다.\n\n','현숙','2024-08-20 12:45:47'),(24,28,'고혈압 관리를 위해 식단 조절과 함께 스트레스 관리가 중요합니다. 저는 요가와 명상을 통해 스트레스를 줄이려고 하고 있습니다. 그리고 나트륨이 적은 간편식을 활용하는 것도 도움이 됩니다. 꾸준한 운동과 건강한 식단이 고혈압 관리에 큰 도움이 됩니다.\n\n','현숙','2024-08-20 12:46:08'),(25,33,'같이 극복해 보아요. ','현숙','2024-08-21 11:56:20'),(26,33,'저도 그런적이 있습니다. 칼슘 섭취가 무엇보다 제일 중요하더라구요.','정숙','2024-08-21 12:08:10'),(27,23,'함께 극복합시다.','영자','2024-08-21 12:19:28'),(28,37,'동의합니다. ','영수','2024-08-21 12:59:04'),(29,37,'피부도 좋아진다죠~^^','옥순','2024-08-21 14:52:34');
