INSERT INTO `qna` VALUES (12,'노인이 되면 누구나 다 요실금이 생기는 것으로 알고 있는데 굳이 치료를 해야 하나요?','min','노인이 되면 누구나 다 요실금이 생기는 것으로 알고 있는데 굳이 치료를 해야 하나요? ','2024-08-19 15:05:54'),(13,'보청기를 사용하면 정상 청력으로 돌아올 수 있는 건가요?','bomari','보청기를 사용하면 정상 청력으로 돌아올 수 있는 건가요?','2024-08-19 15:14:40'),(14,'노인성난청 발생을 예방할 수 있는 방법은 없나요?','2eemj000','노인성난청 발생을 예방할 수 있는 방법은 없나요?','2024-08-19 15:16:25'),(15,' 몇 년 전부터 고혈압, 당뇨병, 관절염이 있어서 각 질병의 전문의에게 약을 처방받아 복용하다보니 매일 먹는 약이 7가지입니다. 모두 유명한 의사들이니 문제없지 않을까요?','taeeun',' 몇 년 전부터 고혈압, 당뇨병, 관절염이 있어서 각 질병의 전문의에게 약을 처방받아 복용하다보니 매일 먹는 약이 7가지입니다. 모두 유명한 의사들이니 문제없지 않을까요?','2024-08-19 15:31:30'),(16,'만성질환을 가진 노인은 운동을 어떻게 해야 하나요?','김복자',' 만성질환을 가진 노인은 운동을 어떻게 해야 하나요?','2024-08-19 15:33:10'),(17,'아무런 증상이 없는데, 왜 고혈압 치료를 받아야 하나요?','마석삼','증상이 없으니 굳이 약을 안먹고 싶은데, 그러면 안되나요..? 약 먹기 싫습니다...','2024-08-19 15:36:44'),(18,'고혈압이나 당뇨 등 질환이 있는 노인의 식사관리에 있어서 주의할 점은 무엇입니까?','김복자','남편이 고혈압, 당뇨 둘다 가지고 있는데 어떤걸 조심해야하는지 모르겠습니다  .... ','2024-08-19 15:55:24'),(19,'췌장염이 췌장암과 관계가 있나요?','min','췌장염이 췌장암과 관계가 있나요..? 병원에서 췌장염이라는데 혹시 암일까봐 겁이 나네요...','2024-08-19 15:57:59'),(20,'상사병이 난거같을때 치료제가 있을까요?','상철','제가 그사람만보면 심장이 너무빠르게뜁니다.... ','2024-08-20 10:04:37'),(21,'혈당 관리를 잘 하기 위한 생활 습관이나 음식이 있을까요?','현숙','안녕하세요, 저는 68세의 은퇴 교사입니다. 당뇨병이 있어 혈당을 자주 체크하고 있습니다. 혈당을 조절하기 위해 식사를 조절하고 운동을 하려고 노력하고 있지만, 가끔씩 혈당이 급격히 상승해서 걱정이 많습니다. 혹시 당뇨를 잘 관리하는 팁이나 추천하는 식단이 있다면 공유해 주세요. 여러분의 경험이 큰 도움이 될 것 같습니다.\n\n','2024-08-20 12:40:54'),(22,'퇴행성 디스크 증상 개선하고 싶어요','영자','안녕하세요. 66세의 은퇴한 사업가입니다. 퇴행성 디스크로 인해 허리가 자주 아프고, 때로는 다리까지 저리기도 합니다. 물리 치료를 받고 있지만, 통증이 완전히 사라지지는 않네요. 다른 분들은 어떤 방법으로 디스크 문제를 관리하고 계신가요? 효과가 있었던 운동이나 치료 방법이 있다면 공유해 주시면 감사하겠습니다.\n\n','2024-08-20 12:42:19'),(23,'지속적인 우울증 때문에 힘듭니다 ','영철','안녕하세요, 63세의 은퇴한 공무원입니다. 최근 우울감을 느끼고 있어서 기분이 많이 가라앉습니다. 의사와 상담 후 약물 치료를 시작했지만, 심리적 지원도 중요하다는 것을 느끼고 있습니다. 다른 분들은 우울감을 관리하기 위해 어떤 방법을 사용하시나요? 상담, 취미 활동, 또는 다른 도움이 되는 방법이 있다면 공유해 주세요.\n\n','2024-08-20 12:43:40'),(26,'골다공증 예방법','옥순','골다공증을 예방하려면 어떻게 해야 하나요?','2024-08-21 14:53:41');
