INSERT INTO `qna_re` VALUES (28,12,'doctor1','노화가 진행되면 요실금이 발생할 수 있으나 모두 같은 정도의 증상을 발생시키지는 않습니다. 노인일수록 많은 만성질환을 동반하는 경우가 많은데, 이럴수록 정기적인 외부 활동이 꼭 필요함에도 불구하고 요실금으로 인한 스트레스는 외부 활동을 축소시키고, 다른 질환 역시 가속화시키는 악순환을 초래할 수 있습니다.','2024-08-19 15:12:52'),(29,13,'doctor2','노인성난청이 나타난 경우 적절한 보청기를 사용하면 도움을 얻을 수 있습니다. 근래에는 조기에 발견될 경우 빨리 보청기를 착용해 적응을 좋게 하려는 시도가 진행되고 있습니다. 다만 정확한 검진을 통하여 본인의 청력장애 정도나 특성에 맞추어 끼지 않으면 오히려 해가 되거나 착용 시 불편감이 커져 좋은 효과를 볼 수 없을 수 있습니다. 보청기는 일종의 재활수단입니다. 즉 보청기를 이용하여 잘 듣게 되는 것이지 청각신경의 기능이 회복되는 것은 아닙니다.','2024-08-19 15:28:21'),(30,14,'doctor2','노인성난청은 이독성 약물이나 주위 소음 등 일반적인 난청의 위험인자를 피하는 것 이외에 특별한 방법은 알려져 있지 않습니다. 그러나 최근 들어 주위 환경과 노인성난청의 관련성에 대해 담배, 술, 두부외상 등의 영향에 대한 연구가 진행 중입니다. 일종의 노화현상이고 신경기능의 저하이기 때문에 다시 젊은 시절 청력으로 돌아가는 것은 어렵습니다만, 진단과 치료가 빨리 이루어져 조기에 보청기, 인공와우와 같은 재활수단을 활용하는 것이 가장 큰 도움이 됩니다.','2024-08-19 15:30:06'),(31,15,'doctor3','노인분들이 하루에 복용하는 약의 가지 수가 5가지 이상이라면 다약제복용에 해당하며 이런 경우 약물부작용의 위험이 매우 높습니다. 가급적 여러 가지 질병을 동시에 관리해 줄 수 있는 주치의 한분을 정하시고 전체 복용약에 대해 상의를 받아 보셔서 꼭 필요한 약이 아니라면 최대한 줄이는 것이 더 바람직합니다. 또한 단골약국을 정하셔서 처방받은 약은 모두 한군데 약국에서 조제하고 설명을 듣는 것도 약 부작용을 줄이는데 도움이 될 것입니다.','2024-08-19 15:32:04'),(32,17,'doctor2','대부분의 고혈압은 두통이나 코피와 같은 증상이 없는 것이 특징입니다. 고혈압을 치료하지 않으면 심장혈관질환과 뇌혈관 질환에 의한 사망 가능성과 기능 장애로 일상 생활을 영위하지 못할 가능성이 증가됩니다. 따라서 증상이 없어도 고혈압은 치료해야 합니다. 과거에는 노인의 경우에는 고혈압을 치료할 필요가 없다고 생각하기도 하였지만, 임상 연구들에서도 고혈압 치료를 하지 않았을 때에 사망률과 이환률이 증가됨이 입증되었습니다.','2024-08-19 15:37:47'),(33,18,'doctor1','고혈압이나 당뇨가 있는 경우 저염, 저콜레스테롤 등의 제한된 식사를 권유하는 경우가 흔합니다. 그러나,  노인에게 이러한 제한식이 오히려 식욕저하를 일으켜 전반적인 영양 결핍을 초래하는 경우도 흔하므로 주의가 필요합니다.  질병을 가지고 있는 노인에게 식이요법을 할 경우는 일반적 식이제한 원칙에 앞서 노인의 전반적 영양상태나 평소 식생활 습관 및 식이요법 수용도 등을 파악하여 개인별로 받아들여질 정도로 조정하는 것이 좋습니다.','2024-08-19 15:56:21'),(34,19,'doctor3','현재 췌장염과 췌장암을 서로 별개의 질환으로 생각합니다. 다만, 췌장암 덩어리가 췌장액의 흐름을 막아 급성 췌장염으로 내원하는 경우가 있어 주의를 요합니다. 만성 췌장염의 위험 인자는 알코올이고 췌장암의 위험 인자는 흡연입니다만, 이 위험 인자를 함께하는 경우가 많아 만성 췌장염 환자 중 췌장암이 발생하는 경우가 일반인보다 많은 것입니다. 아직 인과관계가 확실하지 않아 오래된 만성 췌장염 환자의 경우, 꼭 췌장암 발생을 염두에 두는 것이 좋습니다.','2024-08-19 16:03:54'),(35,16,'가정의학과 전문의 박호순','저강도 유산소 운동: 걷기, 수영, 자전거 타기 등이 좋습니다. 이러한 운동은 심장과 폐의 건강을 증진하고 체중을 관리하는 데 도움이 됩니다.\n근력 강화 운동: 가벼운 덤벨, 저항 밴드, 체중을 이용한 운동(예: 벽에 기대어 앉기)이 좋습니다. 근육을 강화하고 관절을 안정화하는 데 도움이 됩니다.\n유연성 운동: 스트레칭, 요가, 태극권 등은 유연성을 높이고 운동 범위를 유지하는 데 유용합니다.\n','2024-08-19 17:49:36'),(36,20,'가정의학과 전문의 박호순','상사병, 즉 “사랑의 병” 또는 “연애병”은 감정적으로 심리적인 문제가 영향을 미칠 때 사용되는 비공식적인 용어입니다. 자신의 감정을 이해하고, 그 감정을 정리합니다. 일기 쓰기나 감정 표현을 통해 스스로를 이해하는 것이 중요합니다.상사병은 시간이 지나면 자연스럽게 해결될 수 있는 경우가 많습니다. ','2024-08-20 12:11:32'),(37,23,'가정의학과 전문의 박호순','우울감은 지속적인 관리가 중요합니다. 그림 그리기나 책 읽기와 같은 취미는 기분 전환에 큰 도움이 됩니다.  심리 상담도 좋은 방법이 될 수 있으니 전문가의 도움을 받는 것도 고려해 보세요.\n\n','2024-08-20 12:46:50'),(38,22,'가정의학과 전문의 박호순','퇴행성 디스크로 인한 허리 통증이 정말 힘드시겠습니다. 간단한 허리 스트레칭과 근력 운동을 통해 통증을 줄이며 가능하면 무리하지 않도록 하고, 가벼운 운동을 꾸준히 하세요.','2024-08-20 12:47:21'),(39,21,'가정의학과 전문의 박호순','식사 후 혈당이 급격히 상승하는 것을 방지하기 위해, 단백질과 섬유소가 풍부한 음식을 많이 드시는 것이 좋습니다. 어떤 음식이 내 혈당에 영향을 미치는지 확인하는 것도 좋은 방법입니다. 또한, 전문가와 상담하면서 나에게 맞는 식단을 찾아야 합니다.','2024-08-20 12:47:49'),(42,26,'내과 전문의 김갑수','체중 부하 운동은 골밀도를 높이는 데 효과적입니다.','2024-08-21 14:54:43');
